class Table_driven_agent:
    def __init__(self, pos_percepts):
        self.percept_table = {}
        self.percept = None
        self.pos_percepts = pos_percepts

    def get_action(self, percept):
        return self.rules.apply(percept)

    def train(self, t, rules: Rule_collection):
        self.rules = rules

        for i in range(0, t):

            if len(self.percept_table) == 0:
                for percept in self.pos_percepts:
                    self.percept_table[(percept)] = self.get_action(percept)
            else:
                new_rows = {}
                for percept in self.pos_percepts:
                    for row in self.percept_table:
                        percept_seq = row
                        new_row = {
                            (percept_seq, percept): self.get_action(percept)
                        }
                        new_rows |= new_row
                self.percept_table |= new_rows
    def recv_percepts(self, percepts):
        self.percept = percepts[-1]
        return self.percept_table[percepts]

